import React from "react";
import { Container, Row, Section } from "./LandingHeroElements";

function LandingHero() {
  return (
    <Container>
      <Row>
        <h2>Good Day</h2>
        <h3>Patrick Kahuhia</h3>
      </Row>
      <Section>
        <div className="sectionOne">
          <h4>Check Symptoms</h4>
          <h4>Book Appointment</h4>
        </div>
        <div className="sectionTwo"></div>
      </Section>
    </Container>
  );
}

export default LandingHero;
